 import React from 'react';
//import camp from '../image-asset/Camping.jpg';
import './Card-style.css';
const Card= props =>{
    return(
        <div className= "card-text-center">
            <div className= "overflow">
                <img src= {props.imgsrc} alt= "Camping" className="card-img-top"/>
            </div>
            <div className="card-body text-dark">
            <h4 className="card-title">{props.title}</h4>
            <p className=" card-text"> Organized by Advent Park for happy and advent you </p> <br/>
            <p className= "md-form md-outline input-with-post-icon datepicker">{props.date}</p>
            <p className="md-form md-outline input-with-post-icon timepicke">{props.time} </p>
        </div>
         </div>

    );

}



export default Card;
